import React, { useState, useMemo } from "react";
import { useGetBookingHistoryQuery } from "../../redux/api/bookingApi";

const BookingHistoryModal = ({ booking, onClose }) => {
  const { data, isLoading } = useGetBookingHistoryQuery(booking._id);
  const histories = data?.histories || [];

  const [fieldFilter, setFieldFilter] = useState("");
  const [dateFilter, setDateFilter] = useState("");

  /* -------------------------------------------
     FILTER LOGIC (field & date)
  ------------------------------------------- */
  const filtered = useMemo(() => {
    return histories.filter((h) => {
      // Filter by field name
      if (
        fieldFilter &&
        !h.changes.some((c) =>
          c.field.toLowerCase().includes(fieldFilter.toLowerCase())
        )
      ) {
        return false;
      }

      // Filter by date
      if (dateFilter) {
        const histDate = new Date(h.createdAt).toISOString().slice(0, 10);
        if (histDate !== dateFilter) return false;
      }

      return true;
    });
  }, [histories, fieldFilter, dateFilter]);

  /* -------------------------------------------
     COLOR FOR FIELD TYPES (optional enhancement)
  ------------------------------------------- */
  const colorForField = (field) => {
    if (field === "status") return "text-primary fw-bold";
    if (field === "totalAmount") return "text-success fw-bold";
    if (field === "pax") return "text-warning fw-bold";
    if (field === "flightType") return "text-info fw-bold";
    return "text-dark";
  };

  return (
    <div
      className="modal fade show"
      style={{ display: "block", background: "rgba(0,0,0,0.6)" }}
    >
      <div className="modal-dialog modal-xl modal-dialog-scrollable">
        <div className="modal-content">
          {/* HEADER */}
          <div className="modal-header">
            <h5 className="modal-title">
              Booking History â€” {booking.user?.name}
            </h5>
            <button className="btn-close" onClick={onClose}></button>
          </div>

          {/* FILTERS */}
          <div className="modal-body">
            <div className="d-flex gap-3 mb-3">
              <input
                type="text"
                className="form-control"
                placeholder="Filter by field (status, pax, amount...)"
                value={fieldFilter}
                onChange={(e) => setFieldFilter(e.target.value)}
              />

              <input
                type="date"
                className="form-control"
                value={dateFilter}
                onChange={(e) => setDateFilter(e.target.value)}
              />
            </div>

            {/* LOADING */}
            {isLoading && (
              <div className="text-center py-5">Loading history...</div>
            )}

            {/* NO DATA */}
            {!isLoading && filtered.length === 0 && (
              <div className="text-center py-5 text-muted">
                No history found
              </div>
            )}

            {/* HISTORY LIST */}
            {!isLoading &&
              filtered.map((row, index) => (
                <div
                  key={index}
                  className="border rounded p-3 mb-3 bg-light shadow-sm"
                >
                  {/* HEADER */}
                  <div className="d-flex justify-content-between">
                    <div>
                      <strong>
                        {new Date(row.createdAt).toLocaleString()}
                      </strong>
                      <br />
                      <small className="text-muted">
                        Updated by: {row.updatedBy?.name || "Unknown"}
                      </small>
                    </div>
                  </div>

                  <hr />

                  {/* CHANGES */}
                  {row.changes.map((c, idx) => (
                    <div
                      key={idx}
                      className="mb-2 p-2 rounded bg-white shadow-sm"
                    >
                      <div className={colorForField(c.field)}>
                        ðŸ”¹ {c.field.toUpperCase()}
                      </div>

                      {/* DIFF VIEW */}
                      <div className="d-flex justify-content-between mt-1">
                        <div
                          className="flex-fill p-2 me-2 rounded"
                          style={{ background: "#ffe5e5" }}
                        >
                          <small className="text-muted">OLD</small>
                          <div>{String(c.oldValue ?? "-")}</div>
                        </div>

                        <div
                          className="flex-fill p-2 ms-2 rounded"
                          style={{ background: "#e5ffe8" }}
                        >
                          <small className="text-muted">NEW</small>
                          <div>{String(c.newValue ?? "-")}</div>
                        </div>
                      </div>
                    </div>
                  ))}
                </div>
              ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default BookingHistoryModal;
